import React from "react";
import DesktopLayout from "../components/WebDesktop/DesktopLayout";
import Link from "next/link";
import Card from "../components/card";

class Index extends React.Component {


  render() {
    return (
      <DesktopLayout>
        <form class="form-inline">
          <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" color="blue" />
          <button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
        </form>
        <div className="row">
          <Card name={'Ventas'} total={'500'} color={'gray'} />
          <Card name={'Comisiones'} total={'1000'} color={'skyblue'} />
          <Card name={'Retefuente'} total={'1000'} color={'red'} />
          <Card name={'Reteica'} total={'1000'} color={'pink'} />
          <Card name={'Reteica'} total={'1000'} color={'orange'} />
        </div>
        <div>probando </div>
      </DesktopLayout>
    );
  }
}


export default Index;
